import React from "react";
import { Button } from "react-scroll";
import Video from "../../videos/MVI_0358.mp4";
import {
  ActionContainer,
  ActionBg,
  VideoBg,
  ActionContent,
  ActionH1,
  ActionH2,
  ActionBtnWrapper,
} from "./ActionElements";

export const ActionSection = () => {
  return (
    <ActionContainer>
      <ActionBg>
        <VideoBg autoPlay loop muted src={Video} type="video/mp4" />
      </ActionBg>
      <ActionContent>
        <ActionH1 id="s1">
          개발자,
          <br /> 어떤 사람이여야 될까요?
        </ActionH1>
        <ActionH2>코드를 잘 짜고 효율적인 사람?</ActionH2>
        <ActionH2>트랜디하고 진취적인 사람?</ActionH2>
        <ActionBtnWrapper>
          <Button to="about">
            /* {hover ? <ArrowForward /> : <ArrowRight />} */}
          </Button>
        </ActionBtnWrapper>
      </ActionContent>
    </ActionContainer>
  );
};
